def from_aiff_to_numbers(file_name):
    """Read an audio file and translate the audio to frames (amplitudes at points in time)"""
    total_path = FOLDER_PATH + r'/test/' + file_name #Change train to test depending
    
    s = aifc.open(total_path, 'r')
    
    #print s.getframerate() #2000 Return the sampling rate (number of audio frames per second)
    
    nframes = s.getnframes() #The total number of audio frames in the file
    
    #print s.getparams() #(1, 2, 2000, 4000, 'NONE', 'not compressed') #Get all the data at the same time
    
    #If nframes is lower, the entire sound will not be read
    strsig = s.readframes(nframes) #Returned data is a string containing for each frame the uncompressed samples of all channels
    
    #Digital audio samples are discrete values (numbers) which represent the amplitude of an audio signal taken at different points in time
    
    y = numpy.fromstring(strsig, numpy.short).byteswap() #Amplitudes: [74  200  -22 ..., -204  107  -11] 4000 long (same as nframes)
    
    y = list(y)
    
    return y


