def save_to_pickle(name,data):
    """Save the list to a pickle file"""
    pickleFileName = FOLDER_PATH + name + r'.pickle'
    
    pickleFile = open(pickleFileName, 'wb')
    
    pickle.dump(data, pickleFile, pickle.HIGHEST_PROTOCOL)
    
    pickleFile.close()
    

def average_spectrogram_all_data(data):
    """Calculate the average of the spectrogram depending on if there's a whale or not"""
    #256,129:
    TIME = 30 
    FREQ = 129
    #256,192:
    #TIME = 59 
    #FREQ = 129
    average_data = [[0 for cols in range(TIME)] for item in range(FREQ)] #Add zeros
    total = 0
    for item in data:
        if item[1] == 1:
            amplitudes = from_aiff_to_numbers(item[0])
            return_data = plt.specgram(amplitudes,NFFT=256,noverlap=128)
            pxx = return_data[0]
            
            for counter,row in enumerate(pxx):
                for counter2,point in enumerate(row):
                    average_data[counter][counter2] += point
            
            total += 1
            
    #Calculate the average of the amplitudes at each frequency
    average_amp = [[0 for cols in range(TIME)] for item in range(FREQ)] #Add zeros
    for counter,row in enumerate(average_data):
        for counter2,point in enumerate(row):
            average_amp[counter][counter2] = round(float(point)/total,2)
    
    #Limit to lower frequencies
    average_amp = average_amp[13:49:1] #Was 17
    
    #Limit time
    average_amp_time_limit = []
    for item in average_amp:
        average_amp_time_limit.append(item[6:22:1])
    average_amp = average_amp_time_limit
    
    #need to reverse or the plot will be upside-down
    reversed_amp = average_amp[::-1]
    
    #save_to_pickle(r'/average_amp_256_128', average_amp)
    
    return reversed_amp


